import React from "react";
import AboutUsCard from "./components/AboutUsCard";

const App = () => {
	return (
		<div>
			<div className="container">
				<div className="row mt-5 justify-content-center">
					<AboutUsCard />
				</div>
			</div>
		</div>
	);
};

export default App;
